UPDATE - 

So you may of all seen the news I am unfortunately missing Oulton Park this weekend. I will be about spectating, however the BSB medics have said that having 2 concussions close together (7/8weeks) it is best to let my brain heal for longer. I have been doing everything I can to be fully fit (head wise) as physically I’m perfectly ok. I have been in the hyperbaric chamber (@_healthy_healing ) every morning I can be since the crash to aid recovery also I have seen specialists and am currently following a return to sports plan to hopefully be able to race at Donington. I want to thank everybody who continues to support me, this has been the most miserable year not only for myself but also my side of the garage, we will continue to dig in and I would love to end with a few good races. Thank you to my sponsors for the constant support and thank you everyone who is always behind me, my fan base/supporters are the 🥜 thank you and see you soon!!

